        {
          src: "",
        },
      ],
      Comments: [
        {
          User: {
            nickname: "nero",
          },
          content: "제로초 강의 보고있어요",
        },
      ],
    },
  ],
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducer;
